import React from "react";
import Header, { onContactUsPage } from "../../component/header/Header";
import styles from "../main/Main.module.css";
import ContactUs from "../../component/contents/contactus/ContactUs";

function Main() {
  console.log(onContactUsPage);
  return (
    <div className={styles.container}>
      <Header />
      <ContactUs />
      <div className={styles.item1}>
        {/* <div className={styles.item1Circle}></div> */}
        <div className={styles.item1Card}>
          <h1>Content</h1>
          <a href="#" className={styles.arrow}></a>
        </div>
      </div>
      <div className={styles.item2}>
        <div className={styles.item1Card}>
          <h1>Phortpolio</h1>
          <a href="#" className={styles.arrow}></a>
        </div>
      </div>
      <div className={styles.item3}>
        <div className={styles.item1Card}>
          <h1>simulated investment</h1>
          <a href="#" className={styles.arrow}></a>
        </div>
      </div>
      <div className={styles.item3}>
        <div className={styles.item1Card}>
          <h1>contact us</h1>
          <a href="#" className={styles.arrow}></a>
        </div>
      </div>
    </div>
  );
}

export default Main;
